    // } else if (isSuccessShops) {
      contentShops = shops.map(shopId => <Shop setShop={setShop} key={shopId} shopId={shopId}/>)
    // } 



    return(
      // <div className='sticky'>
        <div className='shopsMenu'>
          <h2 className='shopsTitle'>Shops:</h2>
          {contentShops}
        </div>
      // </div>



    );
}

